  \"2016-11-25T21:06:33.221755\",\n\t\"name\": \"elementary-school-math-professional-development-impact-evaluation\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Elementary School Math Professional
  Development Impact Evaluation (Elementary School Math PD Evaluation) is a data collection
  that is part of the Professional Development Impact Program (PD Impact). Elementary
  School Math PD Evaluation <http://ies.ed.gov/ncee/projects/evaluation/tq_mathpd.asp>
  examines the implementation and impact of the Math Professional Development (PD)
  program, by means of collecting fourth-grade teachers' content knowledge, classroom
  practices, and their student's achievement for one academic year. Two-hundred such
  volunteer teachers from six local education agencies (LEAs) were recruited to be
  randomly assigned to either an experimental or control group. Teachers in the experimental
  group were given the PD intervention, whereas teachers in the control group engaged
  in their LEAs' and schools' standard PD regimen over the 2013-14 academic year.
  At the end of the experimental period, a survey was then administered to obtain
  teacher background information for covariate use in the impact analyses. Key statistics
  produced from Elementary School Math PD Evaluation include, inter alia, the implementation
  of the PD program and its impact on the participating teachers' students' achievement
  in the classroom.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
